import { createAction, handleActions } from 'redux-actions'

const SAMPLE_ACTION = 'auth/SAMPLE_ACTION'

const CHANGE_NICKNAME = createAction(SAMPLE_ACTION)

const initialState = {
  id: 'ssafy',
  password: 'ssafy',
}

const auth = (state = initialState, action) => {
  switch (action.type) {
    case 'CHANGE_NICKNAME':
      return {
        ...state,
      }
  }
}

export default auth
